import React from 'react';
import Header from './components/Header/Header';
import Hero from './components/Hero/Hero';
import MainLeftHeader from './components/MainLeftHeader/MainLeftHeader';
import MainLeftText from './components/MainLeftText/MainLeftText';
import MainLeftComments from './components/MainLeftComments/MainLeftComments';
import MainAside from './components/MainAside/MainAside';

function App() {
  return (
    <>
      <Header/>
      <Hero />
      <MainLeftHeader />
      <MainLeftText />
      <MainLeftComments />
      <MainAside />

    </>
  );
}

export default App;
